- input: "TEXT\x1CC00471771\x1CTEXT1010\x1C\x1CF3A\x1CThis report replaces report
    FEC-730118 which incorrectly states the name of the Treasurer as of the date the
    report was filed. Timothy Vance resigned from the post of Treasurer as of 4/13/2011.
    An amended Statement of Organization was filed on that date naming Michael Maddi
    as Treasurer. The Committee failed to appropriately update its computer software
    with respect to its April, 2011 quarterly report and with respect to amended filings
    which were made on 5/26/11 and 5/28/11, and as a result, Mr. Vances name incorrectly
    appears as Treasurer in the electronic filings of those dates.\n"
